import React from "react";

function Create(props) {
    const x = document.getElementById(props.id);
    const v = x.value;
    document.getElementById("create_name").innerHTML = v; 
    return(
        <div style={{border: "solid", padding:"10px"}} id = "new_contact">

            <h1 id = "create_name"></h1>

            <div>
            Type of contact: <input type = "text" id = "type"/> <br/><br/>
            Number: <input type = "text" id = "number"/> <br/><br/>
            </div>

        </div>
    );
}

export default Create;
